import React from "react";
import styled from "styled-components";

export const Container = styled.div`
  background-color: white;
  padding-top:23px;

`;
const TransactionLog = () => {
  return (
    <Container>
      <tr>
    <th>Company</th>
    <th>Contact</th>
    <th>Country</th>
  </tr>
  <tr>
    <td>Alfreds Futterkiste</td>
    <td>Maria Anders</td>
    <td>Germany</td>
  </tr>
    </Container>
  );
};

export default TransactionLog;
